import './App.css';
import Navbar from './Components/Navbar.js';
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link
} from "react-router-dom";

import Blog from './Components/Blog.js';
import Home from './Components/Home.js';

function App() {
  return (
    <Router>

          <div className="App">
              <Navbar/>
          </div>

        <Routes>
          <Route path="/">
            <Home />
          </Route>

          <Route path="/blog">
            <Blog />
          </Route>


      </Routes>
    </Router>


  );
}

export default App;
